--DBの作成
CREATE DATABASE asset_sim;
--ユーザーにDBの権限をまとめて付与
GRANT ALL PRIVILEGES ON DATABASE asset_sim TO postgres;
--DBを切り替え
\c asset_sim;
--テーブルを作成
CREATE TABLE stocks (
    id SERIAL PRIMARY KEY,
    date VARCHAR(20),
    world_dollar DOUBLE PRECISION,
    world_yen DOUBLE PRECISION,
    sp500_dollar DOUBLE PRECISION,
    sp500_yen DOUBLE PRECISION
);


